def make_palindrome(string: str) -> str:
    n = len(string)
    if n == 0:
        return ''
    s_reversed = string[::-1]
    t = string + '#' + s_reversed
    pi = [0] * len(t)
    for i in range(1, len(t)):
        j = pi[i-1]
        while j > 0 and t[i] != t[j]:
            j = pi[j-1]
        if t[i] == t[j]:
            j += 1
        pi[i] = j
    k = pi[-1]
    return string + string[:n - k][::-1]

