def fix_spaces(text):
    n = len(text)
    i = 0
    res = []
    while i < n:
        if text[i] != ' ':
            res.append(text[i])
            i += 1
        else:
            j = i
            while j < n and text[j] == ' ':
                j += 1
            count = j - i
            if count > 2:
                res.append('-')
            else:
                res.append('_' * count)
            i = j
    return ''.join(res)

