    for char in text:
        if char == ' ':
            current_run += 1
        else:
            if current_run > 0:
                if current_run >= 3:
                    result.append('-')
                elif current_run == 2:
                    result.append('__')
                else:
                    result.append('_' * current_run)
            current_run = 0
            result.append(char)
    if current_run > 0:
        if current_run >= 3:
            result.append('-')
        elif current_run == 2:
            result.append('__')
        else:
            result.append('_' * current_run)
    return ''.join(result)

